import axios from "axios"


 let APP_KEY="fd1a2720a5a9633fb0ca1c34e7265233"
 let URL="https://api.openweathermap.org/data/2.5/weather"

 export const fetchweather=async(query)=>{
  let {data}=await axios.get(URL,{
    params:{
      q:query,
      APPID:APP_KEY,
      units:"metric"


    }
  })
  console.log(data)
  return data
 }
